debug = True

class Vertex:
    def __init__(self, idx: int):
        self.idx = idx
        self.children = []


class Graph:
    def __init__(self):
        self.vertexes = {}
        self.edges = {}
        self.all_indegree = {}
        self.num_vertices = 0

    def add_vertex(self, idx: int):
        if idx in self.vertexes:
            return
        v = Vertex(idx)
        self.vertexes[idx] = v
        self.num_vertices += 1

    def add_edge(self, v_idx: int, u_idx: int):
        if v_idx not in self.vertexes or u_idx not in self.vertexes:
            return
        v = self.vertexes[v_idx]
        u = self.vertexes[u_idx]
        v.children.append(u)
        u.children.append(v)
        if v_idx not in self.edges:
            self.edges[v_idx] = [u_idx]
        elif u_idx not in self.edges[v_idx]:
            self.edges[v_idx].append(u_idx)
        if u_idx not in self.edges:
            self.edges[u_idx] = [v_idx]
        elif v_idx not in self.edges[u_idx]:
            self.edges[u_idx].append(v_idx)

        if v_idx not in self.all_indegree:
            self.all_indegree[v_idx] = 0
        if u_idx not in self.all_indegree:
            self.all_indegree[u_idx] = 0
        self.all_indegree[v_idx] += 1
        self.all_indegree[u_idx] += 1

    def add_edges(self, edges: list):
        for v, u in edges:
            self.add_edge(v, u)

    def find_degree(self, idx: int) -> int:
        if idx not in self.all_indegree:
            return 0
        return self.all_indegree[idx]

    def get_roots(self) -> list:
        roots = []
        for v in self.vertexes.values():
            if self.find_degree(v.idx) == 0:
                roots.append(v)
        return roots

    def get_leaves(self) -> list:
        leaves = []
        for v in self.vertexes.values():
            if len(v.children) == 0:
                leaves.append(v)
        return leaves

    def find_spanning_tree(self, root: Vertex, depth: int) -> list:
        if self.find_degree(root.idx) > depth:
            return []
        if self.find_degree(root.idx) == depth:
            return [root]
        leaves = self.get_leaves()
        spanning_tree = []
        while len(leaves) > 0 and depth > 0:
            leaves = sorted(leaves, key=lambda v: v.idx)
            spanning_tree.append(leaves.pop(0))
            depth -= 1
        for v in self.vertexes.values():
            if v in spanning_tree:
                continue
            spanning_tree.extend(self.find_spanning_tree(v, depth))
        return spanning_tree

    def make_spanning_tree(self, root: Vertex) -> None:
        for v in self.vertexes.values():
            v.children = []
        self.make_spanning_tree_helper(root)

    def make_spanning_tree_helper(self, root: Vertex) -> None:
        if root.idx not in self.edges:
            return
        for u_idx in self.edges[root.idx]:
            u = self.vertexes[u_idx]
            u.children.append(root)
            root.children.append(u)
            self.make_spanning_tree_helper(u)

    def get_edges(self) -> list:
        edges = []
        for v_idx in self.edges:
            edges.extend([[v_idx, u_idx] for u_idx in self.edges[v_idx]])
        return edges

