from collections import deque
from typing import List


class Solution:
    def min_moves_to_obtain_divisible_by_k(self, n: str, k: int = 25) -> int:
        n = int(n)

        if n % k == 0:
            return 0

        result = []
        while n > 0:
            result.append(n % k)
            n //= k

        result.append(0)

        left = 0
        while result[left] == 0:
            left += 1
        if left >= len(result):
            return -1

        result = result[left:]

        right = len(result) - 1
        while result[right] == 0:
            right -= 1
        if right < 0:
            return -1

        result = deque(result)

        result.appendleft(0)
        result.append(0)

        result = list(result)

        n = len(result) - 2
        while n >= 0 and result[n] == 0:
            n -= 1
        if n < 0:
            return -1

        # print(result, n)

        def swap(i: int, j: int) -> int:
            if i == j:
                return 0

            result[i], result[j] = result[j], result[i]
            if n >= 0 and result[n] == 0:
                result[i], result[n] = result[n], result[i]
                result[i], result[n + 1] = result[n + 1], result[i]
                result[n], result[n + 1] = result[n + 1], result[n]

            return 1

        q = deque()
        q.append(n)
        while len(q) > 0:
            i = q.pop()
            if result[i] == 0 and i > n:
                return -1
            elif result[i] == 0 and i < n:
                return -1
            if i - 1 >= 0:
                q.append(i - 1)
            if i + 1 < len(result):
                q.append(i + 1)

            for i in range(len(q)):
                q[i] -= 1
                if q[i] >= 0:
                    if result[q[i]] == 0:
                        result[i] = result[q[i]] = 1
                        if i < n:
                            return swap(i, q[i]) + swap(q[i], i) + 1
                        else:
                            return swap(i, q[i]) + swap(q[i], i) + 2
                    else:
                        result[i] = result[q[i]] = 0
                        if i < n:
                            return swap(i, q[i]) + swap(q[i], i)
                        else:
                            return swap(i, q[i]) + swap(q[i], i) + 1
            if i - 1 >= 0:
                q.append(i - 1)
            if i + 1 < len(result):
                q.append(i + 1)

        return -1

