from typing import List, Set

MAX_INT = 2 ** 31 - 1
MIN_INT = -2 ** 31


class Solution:
    def median(self, seq: List[int], l: int, r: int) -> int:
        if l == r:
            return seq[l]

        if l + 1 == r:
            return min(seq[l], seq[r])

        mid = (l + r) // 2
        left_arr = self.median(seq, l, mid)
        right_arr = self.median(seq, mid + 1, r)
        return self.merge_arr(left_arr, right_arr)

    def merge_arr(self, arr1: List[int], arr2: List[int]) -> int:
        if len(arr1) == 0:
            return arr2[0]

        if len(arr2) == 0:
            return arr1[0]

        if len(arr1) == 1:
            return min(arr1[0], arr2[0])

        if len(arr2) == 1:
            return min(arr1[0], arr2[0])

        return self.get_median_value(arr1, arr2)

    def get_median_value(self, arr1: List[int], arr2: List[int]) -> int:
        i = 0
        j = 0
        median_value = 0

        while i < len(arr1) and j < len(arr2):
            if arr1[i] < arr2[j]:
                median_value = arr1[i]
                i += 1
            else:
                median_value = arr2[j]
                j += 1

        if i == len(arr1):
            median_value = arr2[j]
        elif j == len(arr2):
            median_value = arr1[i]

        return median_value

    def find_pairs_count(self, arr: List[int], m: int) -> int:
        arr.sort()
        return self.count_pairs_with_median(arr, m, len(arr))

    def count_pairs_with_median(self, arr: List[int], m: int, n: int) -> int:
        if n == 0:
            return 0

        if n == 1:
            if m == arr[0]:
                return 1
            return 0

        if m == arr[n - 1]:
            return 1

        l = 0
        r = n - 1
        median = self.median(arr, l, r)

        if median == m:
            return 1

        if median < m:
            l = n - 1
            while l > 0:
                l -= 1
                r = n - 1
                median = self.median(arr, l, r)
                if median == m:
                    return 1
                if median > m:
                    return 0

        if median > m:
            r = n - 1
            while r > 0:
                r -= 1
                median = self.median(arr, l, r)
                if median == m:
                    return 1
                if median < m:
                    return 0

        return self.count_pairs_with_median(arr, m, n - 1) + self.count_pairs_with_median(arr, m, n - 1)

    def find_pairs(self, arr: List[int], m: int) -> int:
        arr.sort()
        return self.count_pairs_with_median(arr, m, len(arr))

    def count_pairs_with_median_fast(self, arr: List[int], m: int) -> int:
        if len(arr) == 0:
            return 0

        if len(arr) == 1:
            if m == arr[0]:
                return 1
            return 0

        l = 0
        r = len(arr) - 1

        if m < arr[r]:
            return 0

        if m > arr[l]:
            return self.count_pairs_with_median_fast(arr[:r], m)

        while l < r:
            median = (l + r) // 2
            if arr[median] == m:
                return 1

            if m < arr[median]:
                r = median - 1
            else:
                l = median + 1

        return self.count_pairs_with_median_fast(arr[:l], m) + self.count_pairs_with_median_fast(arr[l:], m)

