"""
dp solution

we can represent the graph as a matrix, with (x, y, w) as a cell of the matrix,
which represents a path between x and y, with weight w.

We can do a DFS from all the vertices with the weight 0, and store the path lengths.
Then, we can take the kth shortest path from 0 to all the vertices,
and at each step we can take the minimum value from the k shortest paths

time O(n^3)
space O(n^2)
"""

class Solution:
    def kthSmallestPath(self, n: int, m: int, k: int) -> str:
        def dfs(cur: int, x: int, y: int, n: int, m: int, k: int, memo: List[List[int]]):
            if cur >= k:
                return 0
            if (x, y) in memo:
                return memo[(x, y)]
            min_len = float('inf')
            for i in range(n):
                if i!= x and (i, y) not in memo:
                    if i < x:
                        if min_len > dfs(cur+1, i, y, n, m, k, memo):
                            min_len = dfs(cur+1, i, y, n, m, k, memo)
                    else:
                        if min_len > dfs(cur+1, i, y, n, m, k, memo) + m:
                            min_len = dfs(cur+1, i, y, n, m, k, memo) + m
            memo[(x, y)] = min_len
            return min_len

        memo = {}
        return dfs(0, 0, 0, n, m, k, memo)



