            raise TypeError('Can only multiply a vector by a number')
        return Vector(tuple(c * other for c in self.coordinates))

    def __rmul__(self, other: float) -> 'Vector':
        if not isinstance(other, (int, float)):
            raise TypeError('Can only multiply a vector by a number')
        return self * other

    def __neg__(self) -> 'Vector':
        return Vector(tuple(-c for c in self.coordinates))


class Point(Vector):
    def __init__(self, coordinates: Tuple[float,...]):
        super().__init__(coordinates)

    def __sub__(self, other: 'Point') -> 'Vector':
        return super().__sub__(other)

    def __add__(self, other: 'Point') -> 'Point':
        return Point(tuple(a + b for a, b in zip(self.coordinates, other.coordinates)))

