                )
        return Matrix(result)

    def __pow__(self, power, modulo=None):
        if not isinstance(power, int):
            raise Exception(
                "Can only raise to power objects of type int"
            )
        result = Matrix(self.data)
        for _ in range(1, power):
            result *= Matrix(self.data)
        return result

    def __invert__(self):
