from copy import deepcopy

class Intersection(NamedTuple):
    id: int
    in_streets: Dict[int, int]
    out_streets: Dict[int, int]


class Solution:
    def __init__(self, n, m, k, g):
        self.intersections = defaultdict(Intersection)
        self.streets = defaultdict(list)
        self.build_intersections(n, m, k, g)
        self.time = 0

    def build_intersections(self, n, m, k, g):
        for i in range(n):
            self.intersections[i + 1] = Intersection(
                id=i + 1,
                in_streets={},
                out_streets={}
            )
        for i in range(m):
            a, b, c = [int(j) for j in stdin.readline().split()]
            self.streets[a].append((b, c))
            self.streets[b].append((a, c))
            self.intersections[a].out_streets[b] = c
            self.intersections[b].in_streets[a] = c
        self.start = k + 1
        self.finish = g + 1

    def start_intersections(self):
        for i in self.intersections:
            self.intersections[i].in_streets[self.start] = 0

    def dfs_min_time(self, curr, curr_time, visited, road_times):
        if curr in visited:
            return float('inf')
        visited.add(curr)
        if curr == self.finish:
            return curr_time
        res = float('inf')
        for neighbour, road_time in self.intersections[curr].out_streets.items():
            if neighbour not in visited:
                res = min(res, road_time + self.dfs_min_time(neighbour, curr_time, visited, road_times))
        road_times[curr] = res
        return res

    def dfs_min_time_with_start(self, curr, curr_time, visited, road_times):
        if curr in visited:
            return float('inf')
        visited.add(curr)
        if curr == self.start:
            return 0
        res = float('inf')
        for neighbour, road_time in self.intersections[curr].in_streets.items():
            if neighbour not in visited:
                res = min(res, road_time + self.dfs_min_time_with_start(neighbour, curr_time, visited, road_times))
        road_times[curr] = res
        return res

    def min_time(self):
        self.start_intersections()
        visited = set()
        road_times = {}
        return self.dfs_min_time_with_start(self.start, 0, visited, road_times)

    def min_time_with_all_times(self):
        self.start_intersections()
        visited = set()
        road_times = {}
        road_times[self.start] = 0
        return self.dfs_min_time(self.start, 0, visited, road_times)

    def solve(self):
        print(min(self.min_time(), self.min_time_with_all_times()))


