from collections import deque

class Solution:
    def solution(self, stdin: str) -> int:
        # setup
        width, height = [int(x) for x in stdin.split('\n')[0].split()]
        grid = [[x for x in line.split()] for line in stdin.split('\n')[1:]]
        # solve
        queue = deque()
        for y in range(height):
            for x in range(width):
                if grid[y][x] == 'H':
                    queue.append((x, y))

        distances = {(x, y): float('inf') for y in range(height) for x in range(width) if grid[y][x]!= 'H'}
        for x, y in queue:
            distances[(x, y)] = 0
            queue.append((x + 1, y))
            queue.append((x - 1, y))
            queue.append((x, y + 1))
            queue.append((x, y - 1))

        while queue:
            x, y = queue.popleft()
            for newx, newy in ((x + 1, y), (x - 1, y), (x, y + 1), (x, y - 1)):
                if (newx, newy) in distances:
                    distances[(newx, newy)] = min(distances[(newx, newy)], distances[(x, y)] + 1)
                    queue.append((newx, newy))

        # return
        return min(distances.values())

assert solution("5 7\n...V...\n.......\n.......\n...#...\n..###..") == \
    "...V...\n...V...\n..VVV..\n.VV#VV.\n.V###V."
