from typing import List

"""
n * m
solution: O(n * m)
"""
class Solution:
    def min_islands(self, rows: List[str], cols: int) -> int:
        def find(x):
            if parents[x]!= x:
                parents[x] = find(parents[x])
            return parents[x]

        def union(x, y):
            px, py = find(x), find(y)
            if px == py:
                return False
            parents[px] = py
            return True

        parents = [i for i in range(rows * cols)]
        for i in range(rows):
            for j in range(cols):
                if i * cols + j >= rows * cols or i * cols + j < 0 or i < 0 or j < 0:
                    continue
                if rows * cols - 1 - i * cols - j < rows * cols - 1 or i * cols + j >= rows * cols or i >= cols or j >= rows:
                    continue
                if rows[i][j] == "L" and union(i * cols + j, rows * cols - 1):
                    islands += 1
        return islands

assert Solution().min_islands("4 5\nCCCCC\nCCCCC\nCCCCC\nCCCCC", 4, 5) == 0
